	(24, 'Perbaikan Jl. Kalikening Selatan Warung Pak Min', 'Infrastruktur', 'Pemerintah setempat telah memulai perbaikan Jalan Kalikening Selatan yang terletak di sekitar Warung Pak Min. Kondisi jalan yang sebelumnya mengalami kerusakan, seperti berlubang dan aspal yang mulai mengelupas, telah menjadi perhatian warga sekitar. Perbaikan ini bertujuan untuk meningkatkan kenyamanan dan keamanan pengguna jalan, terutama bagi pengendara motor dan pejalan kaki yang sering melintas di area tersebut.\r\n\r\nProses perbaikan mencakup perataan kembali permukaan jalan, penambalan lubang, serta pengaspalan ulang untuk memastikan daya tahan yang lebih lama. Selama pengerjaan, akses jalan mungkin mengalami pengalihan sementara guna mempercepat proses dan menghindari kemacetan.', '1740467618_download.jpg', '2025-02-25 14:13:37'),
	(26, 'Program Makan Gratis Desa Pemuda Karangtaruna', 'Kegiatan', 'Pemerintah Desa bersama Karang Taruna setempat resmi meluncurkan Program Makan Gratis bagi warga kurang mampu di Desa Pemuda. Program ini bertujuan untuk membantu masyarakat yang membutuhkan dengan menyediakan makanan bergizi secara gratis di beberapa titik distribusi yang telah disiapkan. Inisiatif ini diharapkan dapat meringankan beban ekonomi warga sekaligus meningkatkan kepedulian sosial di lingkungan desa.\r\n\r\nPelaksanaan program ini melibatkan berbagai pihak, termasuk donatur, relawan, dan warga desa yang ingin berkontribusi. Setiap harinya, makanan akan disediakan di balai desa dan beberapa lokasi strategis lainnya, sehingga mudah diakses oleh penerima manfaat. Selain itu, Karang Taruna juga aktif dalam mengoordinasikan kegiatan ini, mulai dari pengumpulan dana, pengolahan makanan, hingga pendistribusian kepada warga yang membutuhkan.\r\n\r\nWarga menyambut baik program ini dan berharap dapat berjalan secara berkelanjutan. Pemerintah Desa juga mengajak masyarakat serta pihak swasta untuk turut serta dalam mendukung program ini, baik melalui donasi maupun tenaga sebagai relawan. Dengan adanya Program Makan Gratis ini, diharapkan tidak ada lagi warga yang mengalami kesulitan dalam memenuhi kebutuhan pangan sehari-hari.', '1740467760_download (7).jpg', '2025-02-25 14:15:59'),
	(27, 'Rapat Perdana dengan Bupati Tuban', 'Kegiatan', 'a', '1740467805_download (6).jpg', '2025-02-25 14:16:44'),
	(28, 'Longsor Pinggir Jalan Menutupi Got Jl. Sawahan', 'Infrastruktur', 'a', '1740468380_download (5).jpg', '2025-02-25 14:26:19'),
	(29, 'Jalan Berlubang Akibat Tekanan Mobil Truk', 'Infrastruktur', 'a', '1740468494_download (4).jpg', '2025-02-25 14:28:13'),
	(30, 'Bakti Social Pemuda Karangtaruna Desa kedungmulyo', 'Sosial', 'a', '1740468538_download (3).jpg', '2025-02-25 14:28:57'),
	(31, 'Pembagian Sembako oleh Ibu-ibu PKK', 'Sosial', 'a', '1740468583_download (2).jpg', '2025-02-25 14:29:42'),
