	(12, 'Program Makan Gratis bersama Murid SD Kedungmulyo', 'Pemerintah Desa Kedungmulyo bersama pihak sekolah dan komunitas setempat mengadakan Program Makan Gratis bagi murid SD Kedungmulyo. Program ini bertujuan untuk meningkatkan asupan gizi anak-anak serta mendukung kesehatan dan konsentrasi belajar mereka. Melalui inisiatif ini, para siswa mendapatkan makanan bergizi secara gratis setiap harinya di lingkungan sekolah.\r\n\r\nProgram ini terlaksana berkat kerja sama dengan berbagai pihak, termasuk donatur, relawan, serta dukungan dari orang tua murid. Menu makanan yang disediakan telah disusun oleh tenaga kesehatan agar memenuhi kebutuhan gizi anak-anak. Selain itu, program ini juga mengajarkan pentingnya pola makan sehat dan kebersamaan di antara para siswa.', '1740468327_download (8).jpg', '2025-02-25 14:25:26.316138');

